commits.content:
*,
*::before,
*::after {
	margin: 0;
	padding: 0;
	box-sizing: border-box;
}

body {
	/* width: 100vw; */
	font-family: 'Josefin Sans', sans-serif;
	font-size: 18px;
	background-color: hsl(235, 21%, 11%);
	color: #fff;
}

.root {
	display: flex;
	flex-direction: column;
	align-items: center;
	padding: 0 1.5em 2em;
	min-height: 100vh;
	width: 100vw;
}

